import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Homepage from './components/Homepage';
import Login from './components/Login';
import SignUp from './components/SignUp';
import Product from './components/Product'; // Product bileşenini import ediyoruz
import Cart from './components/Cart'; // Product bileşenini import ediyoruz

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/homepage" element={<Homepage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/product" element={<Product />} /> {/* Ürün sayfası rotasını ekliyoruz */}
        <Route path="/cart" element={<Cart />} /> 
        {/* Diğer rotalar buraya eklenecek */}
      </Routes>
    </Router>
  );
}

export default App;
